<H1><A NAME="c2514"></A><SUP></SUP>Compiler Error C2514</H1>

<P class=dt><B>'class' : class has no constructors</B></P>

<P>The specified class was initialized with parameters for which no constructor was defined.</P>

<P>Constructors must be declared with parameter lists that match every parameter list used to initialize objects of the class, structure, or union.</P>
